// https://leetcode.com/problems/delete-characters-to-make-fancy-string
/**
 * @param {string} s
 * @return {string}
 */
function makeFancyString(word) {
  if (isStringTooSmall(word)) return word;

  const chars = "abcdefghijklmnopqrstuvwxyz";
  const regexMap = new Map();
  chars.split("").forEach((char) => {
    regexMap.set(char, new RegExp(`${char}${char}${char}+`, "g"));
  });
  let tmp = word;
  let done = false;
  const entries = [];
  regexMap.forEach((value, key) => entries.push([key, value]));

  while (!done) {
    for (const [char, regex] of entries) {
      tmp = tmp.replace(regex, `${char}${char}`);
    }

    if (isStringTooSmall(tmp)) {
      // when length is less than 3 it means we don't have anything to replace, so exiting
      done = true;
      continue;
    }

    let count = 0;
    for (const regex of entries) {
      if (tmp.match(regex)) {
        // if there's any character more than 3 times, then we don't need to test for next chars. Just go ahead & do a replace
        break;
      } else count += 1;
    }

    if (count == 26) {
      // when the matching loop is complete that ideally means there's nothing to replace.
      // so just mark it as done
      done = true;
    }
  }
  return tmp;
}

function isStringTooSmall(word) {
  return word.length < 3;
}

const scenarios = [
  {
    input: "leeetcode",
    result: "leetcode",
  },
  {
    input: "aaabaaaa",
    result: "aabaa",
  },
  {
    input: "aab",
    result: "aab",
  },
  {
    input: "aabaabaabaaaaa",
    result: "aabaabaabaa",
  },
  {
    input:
      "",
    result:
      "",
  },
];

test("make fancy string", () => {
  for (const scenario of scenarios) {
    const actual = makeFancyString(scenario.input);
    expect(actual).toEqual(scenario.result);
  }
});
